CREATE Temporary TABLE loc_retail(
	Id          VARCHAR(32) NOT NULL PRIMARY KEY
	,Lat         NUMERIC(19,14) NOT NULL
	,Lng         NUMERIC(18,15) NOT NULL
	,Name        VARCHAR(31) NOT NULL
	,ZoneName    VARCHAR(24) NOT NULL
	,ExpansionId TinyInt NOT NULL
);

Select Unhex(l.Id), z.Id, l.Name, l.Lat, l.Lng
From loc_retail l
Inner Join Zones z
	On z.Name = l.ZoneName
	And z.ExpansionId = l.ExpansionId;

Drop Table loc_retail;
